import Nav from "@/components/nav";
import Hero from "@/components/landing/hero";
import Previous from "@/components/landing/previous";
import Upcoming from "@/components/landing/upcoming";
import { getConfig, getPreviousShows, getUpcomingShows } from "@/lib/api";
import Footer from "@/components/footer";
import { Show } from "@/types";
import { useContentfulLiveUpdates } from "@contentful/live-preview/react";

export default function Home({
  previousShows,
  upcomingShows,
  config,
}: {
  previousShows: Show[];
  upcomingShows: Show[];
  config: any;
}) {
  const updatedConfig = useContentfulLiveUpdates(config);

  return (
    <div className="w-full bg-no-repeat">
      {updatedConfig.fields ? (
        <div>
          <Nav config={updatedConfig.fields} />
          <div className="max-w-7xl mx-auto pt-20">
            <Hero config={updatedConfig.fields} />
            <Upcoming shows={upcomingShows} config={updatedConfig.fields} />
            <Previous shows={previousShows} config={updatedConfig.fields} />
            <Footer config={updatedConfig.fields} />
          </div>
          <div className="svg-background">
            <Background color={updatedConfig.fields.brandColor} />
          </div>
        </div>
      ) : (
        <div className="w-full h-screen flex items-center justify-center">
          <p className="text-center text-white text-xl font-semibold">
            Please add the configuration content into Contentful
          </p>
        </div>
      )}
    </div>
  );
}

export async function getServerSideProps({
  query,
}: {
  query: {
    preview?: string;
  };
}) {
  const isPreview = query.preview !== undefined;
  const config = await getConfig(isPreview);
  const previousShows = await getPreviousShows();
  const upcomingShows = await getUpcomingShows();

  return {
    props: { previousShows, upcomingShows, config: config?.[0] || {} },
  };
}

